import "./App.css";
import Navbar from "./Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import { Route, Routes } from "react-router-dom";
import Points from "./Pages/Points";
import Create from "./Pages/Create";
import Match from "./Pages/Match";
import Schedule from "./Pages/Schedule";
import Raciit from "./Assets/raciit.png";

function App() {
  return (
    <>
      <Navbar />
      <div>
      <img
        src={Raciit}
        style={{ width: "20%", marginLeft: "20%" }}
        alt="Logo"
      />
      <h1>PRO FUTSAL LEAGUE</h1>
      </div>
      <Routes>
        <Route path="/pointsTable" element={<Points />} />
        <Route path="/createClub" element={<Create />} />
        <Route path="/addMatch" element={<Match />} />
        <Route path="/matches" element={<Schedule />} />
      </Routes>
    </>
  );
}

export default App;
